import React from "react";

const ComingSoon = () => {
  return (
    <div className="w-full h-full flex justify-center items-center">
      <div className="text-white text-xl font-bold" style={{ height: "92%" }}>
        Coming Soon...
      </div>
    </div>
  );
};

export default ComingSoon;
